                <h1>panCard</h1>
              </Route>
              <Route path="/voterId/:no">
              <h1>voterId</h1>
              </Route>

            </Switch>
          </Content>
          <Footer style={{ textAlign: 'center', bottom: '0' }}>Â©2021 FormEasy</Footer>
        </Layout>
      </>
    </Router>
  );
}

export default App;
